import React from "react";
import { Row, Col } from "antd";
import PageContent from "../../../layout/components/content/page-content";

function maquinas() {
    return (
   <>
        <Row gutter={[32, 32]}>
      <Col span={24}>
        <h1>Precisas disso? acho que era isso que mete a pagina no menu do lado esquerdo i think</h1>
      </Col>
    </Row>
   </>
    );
}

export default maquinas
